import './App.css'
import MyRoutes from './components/MyRoutes'
import { AuthProvider } from './helper/AuthContext'

function App() {
    const [searchParams] = useSearchParams()
    console.log(searchParams)
    return (
        <Router>
            <AuthProvider>
                <MyRoutes />
            </AuthProvider>
        </Router>
    )
}

export default App
